import Card from "../Card/Card";
function Overview() {
  return (
    <div>
      <div className="cards">
        <Card num={69} solve={"Unresolved"} />
        <Card num={16} solve={"Overdue"} />
        <Card num={43} solve={"Open"} />
        <Card num={64} solve={"On hold"} />
      </div>
      <div className="form">
       .sec-con{
        
       }
        <div className="sec2">
        <Card num={69} solve={"Unresolved"} />
        <Card num={16} solve={"Overdue"} />
        <Card num={43} solve={"Open"} />
        <Card num={64} solve={"On hold"} />
        </div>
      </div>
    </div>
  );
}

export default Overview;
